measurements.description:
One round flower on one upright unsupported 14-cm inflorescence;

	dorsal sepal white, veined dark burgundy, overlaid dark burgundy basally;
	synsepal chartreuse, striped dark chartreuse;
	petals lightly ruffled, chartruse overlaid dark burgundy;
	pouch chartrause heavily overlaid dark burgundy;
	staminode cream, blushed pink distally, dark green spot centrally; 

	substance medium; texture lacquer; commended for brilliant color.
